import React, { useState } from "react";
import { Button, Modal, Carousel } from "antd";

const ProjectModal = ({ open, meta }) => {
  const imageRender = () => {
    if (meta) {
      let i = null;
      for (i = 1; i < 9; i++) {
        return i
      }
    }
  };
  return (
    <Modal title="Modal 1000px width" centered open={open}>
      <Carousel autoplay>
        <div>
          <img src={`/images/meta/meta-${imageRender}`} alt="" />
        </div>
      </Carousel>
    </Modal>
  );
};

export default ProjectModal;
